import React from "react";
import "./index.scss";
import { Collection } from "./Components/Collection";
import axios from "axios";

function App() {
  const [photos, setPhotos] = React.useState([]);
  console.log(photos);

  React.useEffect(() => {
    axios
      .get("https://62ffc93b9350a1e548e663ec.mockapi.io/items/photos")
      .then((obj) => setPhotos(obj.data));
  }, []);

  return (
    <div className="App">
      <h1>Моя коллекция фотографий</h1>
      <div className="top">
        <ul className="tags">
          <li className="active">Все</li>
          <li>Горы</li>
          <li>Море</li>
          <li>Архитектура</li>
          <li>Города</li>
        </ul>
        <input className="search-input" placeholder="Поиск по названию" />
      </div>
      <div className="content">
        {photos.map((item) => (
          <Collection name={item.name} image={item.photos} />
        ))}
      </div>
      <ul className="pagination">
        <li>1</li>
        <li className="active">2</li>
        <li>3</li>
      </ul>
    </div>
  );
}

export default App;
